import React, { useEffect, useLayoutEffect } from "react";

function UseLayoutEffect() {
  useLayoutEffect(() => {
    console.log("UseLayoutEffect");
  }, []);
  useEffect(() => {
    console.log("UseEffect");
  });
  return <div></div>;
}

export default UseLayoutEffect;
